import React from 'react';
import styles from './Navbar.module.css'
import {observer} from "mobx-react-lite";

const Navbar = observer(({types, ...props}) => {
    return (
        <div>
            {types.map((item) => {
                return (

                    <div onClick={() => props.setBrand(item)}
                        key={item.id}
                         className={(props.selectedBrandId == item.id ? styles.active + ' ' + styles.item : styles.item)}>
                        <p>{item.name}</p>
                    </div>
                )
            })}
        </div>
    );
});

export default Navbar;
